class ErrorMessageValidator:
    def __init__(self):
        self.error_messages = []

    def upload_error_messages(self, messages):
        self.error_messages.extend(messages)

    def validate_error_messages(self):
        valid_messages = [msg for msg in self.error_messages if self.is_valid(msg)]
        return valid_messages

    def is_valid(self, message):
        return isinstance(message, str) and len(message) > 0


class BrokerValidationRuleUpdater:
    def __init__(self):
        self.validation_rules = {}

    def update_validation_rules(self, rules):
        self.validation_rules.update(rules)


class FABSDataRetriever:
    def __init__(self):
        self.raw_files = []

    def fetch_raw_agency_files(self):
        # Simulate fetching data from USAspending
        self.raw_files = [
            {"file_id": 1, "agency": "Agency A", "data": "Sample Data A"},
            {"file_id": 2, "agency": "Agency B", "data": "Sample Data B"},
        ]
        return self.raw_files


class FABSStatusUpdater:
    def __init__(self):
        self.submissions = {}

    def update_submission_status(self, submission_id, new_status):
        if submission_id in self.submissions:
            self.submissions[submission_id]['publishStatus'] = new_status


class DataQualityChecker:
    def __init__(self):
        self.data = []

    def add_data(self, data):
        self.data.append(data)

    def ensure_quality(self):
        quality_issues = []
        for record in self.data:
            if not self.is_data_complete(record):
                quality_issues.append(record)
        return quality_issues

    def is_data_complete(self, record):
        return 'PPoPCode' in record and 'PPoPCongressionalDistrict' in record


